import React, { useState, useContext } from "react";
import { Link } from "react-router-dom";
import SearchOutlinedIcon from '@mui/icons-material/SearchOutlined';
import AccountCircleOutlinedIcon from '@mui/icons-material/AccountCircleOutlined';
import GradeOutlinedIcon from '@mui/icons-material/GradeOutlined';
import LocalMallOutlinedIcon from '@mui/icons-material/LocalMallOutlined';
import "./Navbar.css";
import Cart from '../../pages/Cart/Cart';
import { UserContext } from "../../pages/User/UserProvider.jsx"
import { CartContext } from "../../pages/Cart/CartProvider";
import axios from "axios";
import { useEffect } from "react";
import logo from "../../images/CandyLand_Logo_Blue.png";

const Navbar = () => {

  const [open, setOpen] = useState(false);
  const [searchQuery, setSearchQuery] = useState("");
  const { user } = useContext(UserContext);
  const [productRetrieved, setProductRetrieved] = useState(null);
  const [showSearchBar, setShowSearchBar] = useState(false);
  const [productName, setProductName] = useState(null);
  const { cartItems, calculateTotalAmount, clearCart, removeFromCart, checkout, getCartSize, serchForCandy } = useContext(CartContext);

  const candyProducts = [
    // Existing candy products
    // ...
    // Additional candy products
    // ...
  ];

  const handleSearch = async (e) => {
    setSearchQuery(e);
    try {
      const response = await axios.post(
        "http://localhost:4000/api/search",
        { productName }
      );
      if (response.data) {
        console.log("Product found");
        setProductRetrieved(response.data);
      } else {
        console.log("Search failed");
      }
    } catch (error) {
      console.error("Could not find product", error);
    }
  };

  const handleDropdownItemClick = (name) => {
    setSearchQuery(name);
    setProductRetrieved(null);
  };

  return (
    <div className="Navbar">
      <div className="wrapper">
        <div className="center">
          <Link className="link" to="/">
            <img className="logo" src={logo} alt="Candyland Logo" />
          </Link>
        </div>
        <div className="left"></div>
        <div className="item">
          <Link className="link" to="/products/CandyBar">
            Candy Bars
          </Link>
        </div>
        <div className="item">
          <Link className="link" to="/products/CandyCorn">
            Candy Corn
          </Link>
        </div>
        <div className="item">
          <Link className="link" to="/products/CandyStick">
            Candy Sticks
          </Link>
        </div>
        <div className="right">
          {/* Search Bar */}
          <div className="searchBar">
            <input
              className="searchInput"
              type="text"
              value={searchQuery}
              onChange={(e) => setSearchQuery(e.target.value)}
              placeholder="What are you looking for?"
              onFocus={() => setShowSearchBar(true)}
              onBlur={() => setShowSearchBar(false)}
            />
            <div className="searchButton" onClick={handleSearch}>
              <SearchOutlinedIcon className="searchIcon" />
            </div>
            {showSearchBar && searchQuery && (
              <div className="dropDownMenu">
                {candyProducts
                  .filter((item) =>
                    item.name.toLowerCase().startsWith(searchQuery.toLowerCase())
                  )
                  .slice(0, 5)
                  .map((item) => (
                    <div
                      onClick={() => handleDropdownItemClick(item.name)}
                      className="dropDownRow"
                      key={item.id}
                    >
                      {item.name}
                    </div>
                  ))}
              </div>
            )}
          </div>
          <div className="item">
            <Link className="link" to="/account">
              <AccountCircleOutlinedIcon className="navIcon" />
            </Link>
          </div>
          <div className="item">
            <Link className="link" to="/favorites">
              <GradeOutlinedIcon className="navIcon" />
            </Link>
          </div>
          <div className="item">
            <Link className="link" to="/cart">
              <LocalMallOutlinedIcon className="navIcon" />
              {getCartSize() > 0 && (
                <div className="cartItemCount">{getCartSize()}</div>
              )}
            </Link>
          </div>
        </div>
      </div>
      {/* Cart Sidebar */}
      <Cart
        open={open}
        setOpen={setOpen}
        cartItems={cartItems}
        calculateTotalAmount={calculateTotalAmount}
        clearCart={clearCart}
        removeFromCart={removeFromCart}
        checkout={checkout}
      />
    </div>
  );
};

export default Navbar;
